import React from "react";

import Header_box from "./Header_box";
import Search_bar from "./Search_bar";
import Select_range from "./Select_range";

function Header(){
    return(
        <>
         <Header_box>
              <Search_bar></Search_bar>
              <Select_range></Select_range>
         </Header_box>
        </>
    );
}

export default Header
